no aaa root
no username admin
!
username cvpadmin privilege 15 role network-admin secret sha512 $6$AaDdEKIbgFjyA43J$7o8TB0OZkfczDp257De/uiSFmDK/w91tweetQBDAvpv0lJ17/twsXuun5/Vdad5R7CcYQKlACNL7QVNtPPE/g.
username cwomble secret *
username cwomble ssh-key ssh-rsa 
username dlyssenko secret *
username dlyssenko ssh-key ssh-rsa 
username ec2-user shell /bin/bash nopassword
username ec2-user ssh-key ssh-rsa ssh-rsa  nonroot@buildkitsandbox
username gcp-user secret *
username gcp-user ssh-key ssh-rsa 
username mircea secret *
username mircea ssh-key ssh-rsa 
username service shell /bin/bash secret sha512 $6$SfwkxR11PSaSeWzi$plju2C5ddD3U4.I9NtlGmJ8zRtwROI8mAv4hkA5XU07YwGKbJ/FhFIbYFZzji7PR.Bj7gfqSbe2TT.unh9JYe1
!
agent KernelFib environment KERNELFIB_PROGRAM_ALL_ECMP='true'
!
management api http-commands
   no shutdown
!
no service interface inactive port-id allocation disabled
!
transceiver qsfp default-mode 4x10G
!
service routing protocols model multi-agent
!
hostname NYC-FD-Host-B
ip name-server vrf default 169.254.169.254
!
spanning-tree mode mstp
!
system l1
   unsupported speed action error
   unsupported error-correction action error
!
vrf instance Et1
!
vrf instance Et2
!
aaa authorization exec default local none
!
interface Ethernet1
   no switchport
   vrf Et1
   ip address 10.11.20.21/24
!
interface Ethernet2
   no switchport
   vrf Et2
   ip address dhcp
   dhcp client accept default-route
!
interface Management1
   ip address 192.168.0.16/24
!
ip routing
no ip routing vrf Et1
no ip routing vrf Et2
!
ip route vrf Et1 0.0.0.0/0 10.11.20.1
!
router multicast
   ipv4
      software-forwarding kernel
   !
   ipv6
      software-forwarding kernel
!
